import React from 'react';

const Input = props => {
    return (
        <div>
            <label>{props.title}</label>
            <input 
                id={props.name} 
                className="form-control" 
                name={props.name} 
                value={props.value} 
                type={props.inputType} 

            />
        </div>
    )
}

export default Input;
